const Song = ({ title, artist, year, isActive, onDoubleClick }) => {
    const SongStyle = {
        border: '1px solid #ddd',
        padding: '10px',
        marginBottom: '10px',
        backgroundColor: isActive ? '#e9ecef' : '#f9f9f9',
    };

    return (
        <div style={SongStyle} onDoubleClick={() => onDoubleClick(title)}>
            <h3>Song</h3>
            {title && <p>Title: {title}</p>}
            {artist && <p>Artist: {artist}</p>}
            {year && <p>Year: {year}</p>}
        </div>
    );
};

export default Song;
